db.contents.insertOne({ categories: [ ObjectId("5de8a19612f1876c9365ea47") ], tags: [ ObjectId("5deb726f16c2ad315f2d02b7") ], isSeries: false, country: [ ObjectId("5de8b686641f4253ad09d2f8") ], subCategories: [ ObjectId("5de8dbedcc446376c1110ebd") ], isFree: true, isFreeForAzam: true, status: true, packageID: [], isDeleted: false, isEpisode: false, images: [], _id: ObjectId("5e007ff731dad5631cb69a58"), contentType: 'NEWS', title: 'Adidas with Beyonce to launch new collection', description: 'Adidas will start selling a new collection designed with singer Beyonce on January 18 in a relaunch of her Ivy Park brand that includes shoes, clothes and accessories, mostly in maroon, orange and cream.\n\nAdidas described the collection, which features on the cover of January’s Elle magazine, as gender neutral. It includes jumpsuits, cargo pants, hoodies and cycling shorts, mostly featuring signature Adidas triple-stripes.\n\nThe German sportswear brand announced it was teaming up with the singer in April to relaunch the Ivy Park brand Beyonce started in 2016 together with British fashion chain Topshop. The company did not give financial details.\n\nThe partnership comes as Adidas seeks to attract more female customers, an area where it has lagged bigger rival Nike and German competitor Puma, which saw its sales boosted by a collaboration with singer Rihanna that ended last year.\n\nAdidas does not expect much of an immediate help to sales from the initial Beyonce collection, but it will ramp up overtime, Chief Executive Kasper Rorsted told analysts in November.\n\n“You’re going to see several launches coming up, but they have no substantial revenue impact and this has been part of the plan all the time. You will see that change throughout next year,” the CEO said.\n\nAdidas has eroded Nike’s dominance of the US market in recent years, helped by partnerships with celebrities like Kanye West and Pharrell Williams, but Nike has been growing faster in China and Europe, a trend that continued in the latest results.\n\nIvy Park said last year Beyonce had bought the fitness clothing brand from Topshop.\n', priceDetail: [], imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/ADIDAS_1576820050-8635621dee1624602ebb94afd103d599.jpg', series: [], referenceChannelID: null, createdAt: new Date("Mon, 23 Dec 2019 08:51:03 GMT"), updatedAt: new Date("Mon, 23 Dec 2019 08:51:03 GMT"), __v: 0 }, { session: null })
db.searchcontentmodels.insertOne({ _id: ObjectId("5e007ff731dad5631cb69a59"), contentId: ObjectId("5e007ff731dad5631cb69a58"), name: 'Adidas with Beyonce to launch new collection|Adidas will start selling a new collection designed with singer Beyonce on January 18 in a relaunch of her Ivy Park brand that includes shoes, clothes and accessories, mostly in maroon, orange and cream.\n\nAdidas described the collection, which features on the cover of January’s Elle magazine, as gender neutral. It includes jumpsuits, cargo pants, hoodies and cycling shorts, mostly featuring signature Adidas triple-stripes.\n\nThe German sportswear brand announced it was teaming up with the singer in April to relaunch the Ivy Park brand Beyonce started in 2016 together with British fashion chain Topshop. The company did not give financial details.\n\nThe partnership comes as Adidas seeks to attract more female customers, an area where it has lagged bigger rival Nike and German competitor Puma, which saw its sales boosted by a collaboration with singer Rihanna that ended last year.\n\nAdidas does not expect much of an immediate help to sales from the initial Beyonce collection, but it will ramp up overtime, Chief Executive Kasper Rorsted told analysts in November.\n\n“You’re going to see several launches coming up, but they have no substantial revenue impact and this has been part of the plan all the time. You will see that change throughout next year,” the CEO said.\n\nAdidas has eroded Nike’s dominance of the US market in recent years, helped by partnerships with celebrities like Kanye West and Pharrell Williams, but Nike has been growing faster in China and Europe, a trend that continued in the latest results.\n\nIvy Park said last year Beyonce had bought the fitness clothing brand from Topshop.\n|News|Entertainment|Entertainment|', __v: 0 }, { session: null })
